description:
Lyla gives us a slow grind to get it started and we're enjoying the show. It puts us in a festive mood and when we're feeling festive, we like to spread the wealth...We tie Lyla between two beams and get to work on her. She shrieks as her body is sent into a tickled frenzy...Four hands are better than one though and Damon applies the vibe while the tickling ensues...
